  <section id="game">

    <canvas width="160" height="144"></canvas>

    <table>
      <tr>
        <td>
          <p>Choose one of the available games</p>
          <select id="hosted_rom">
            <optgroup label="Licensed games (TO BE REMOVED!!!)">

              <option>Alleyway</option>
              <option>Super Mario Land</option>
              <option>Super Mario Land 2 - 6 Golden Coins</option>

              <option>Duck Tales</option>
              <option>Motocross Maniacs</option>
              <option>Prince of Persia</option>
              <option>Double Dragon</option>
              <option>Mega Man II</option>
            </optgroup>
            <optgroup label="Homebrew games">
              <option>Espionage - Fredrik Brundin</option>
              <option>Adjustris - </option>
            </optgroup>
            <optgroup label="Demos">
              <option>gejmb√•j - Snorpung</option>
              <option>oh! - Snorpung</option>
              <option>20y - Snorpung</option>
              <option>demon blood - Youth Uprising</option>

              <option>Music Tech - PIXELH8</option>
              <option>Little Sound Dj (demo) - ?</option>

              <option>cpu_instrs</option>
              <option>dmg_sound</option>
              <option>dmg_sound-2</option>

              <option>mem_timing-2</option>
              <option>oam_bug</option>
              <option>oam_bug-2</option>
            </optgroup>
          </select>
        </td>
        <td>
          <p>OR</p>
        </td>
        <td>

          <input type="file" id="local_rom"/>
        </td>
      </tr>

    <section id="error"></section>

  </section>
  
  <section id="debugger">

    <section id="buttons">
      <button>Pause</button>
      <button>Step</button>
      <button>Run</button>
    </section>
    
    <section id="registers">
      <table>
        <tr><td>AF</td><td></td></tr>

      <input type="checkbox" name="carry"/><label>C</label>

    <section id="memory">
      <input type="text" name="address" value="0"/>
      <button name="go_to_address">Go to address</button>
      <table>
      </table>
    </section>

    <section id="breakpoints">

  </section>
